import React from 'react';
import Card from './Card';

function Service() {
    return (
        <>
            <div className="container service">
                <h3 style={{ textAlign: 'center' }}>Our Services</h3>
                <div className="cardContent">
                    <Card className="card" />
                    <Card className="card" />
                    <Card className="card" />
                    <Card className="card" />
                    <Card className="card" />
                    <Card className="card" />
                </div>
            </div>

        </>
    )
}

export default Service;
